  [],\n\t\"revision_timestamp\": \"2015-05-06T23:19:12.966179\",\n\t\"name\": \"shuttle-sbuv-ssbuv-solar-spectral-irradiance-v008\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Shuttle Solar Backscatter Ultraviolet
  (SSBUV) level-2 irradiance data are available for eight space shuttle missions flown
  between 1989 and 1996. SSBUV, a successor to the SBUV flown on the Nimbus-7 satellite,
  is nearly identical to the SBUV/2 instruments flown on the NOAA polar orbiting satellites.
  Data are available in an ASCII text format. UV irradiance data are available for
  the following days from the eight missions:nnFlight #1: 1989 October 19, 20, 21nFlight
  #2: 1990 October 7, 8, 9nFlight #3: 1991 August 3, 4, 5, 6nFlight #4: 1992 March
  29, 30nFlight #5: 1993 April 9, 11, 13, 15, 16nFlight #6: 1994 March 14, 15, 17nFlight
  #7: 1994 November 5, 7, 10, 13nFlight #8: 1996 January 12, 16, 18n      nThe Shuttle
  SBUV (SSBUV) instrument measured solar spectral UV irradiance during the maximum
  and declining phase of solar cycle 22. The SSBUV data accurately represent the absolute
  solar UV irradiance between 200u2013405 nm, and also show the long-term variations
  during eight flights between October 1989 and January 1996. These data have been
  used to correct long-term sensitivity changes in the NOAA-11 SBUV/2 data, which
  provide a near-daily record of solar UV variations over the 170u2013400 nm region
  between December 1988 and October 1994. These data demonstrate the evolution of
  short-term solar UV activity during solar cycle 22.n\",\n\t\"license_title\": \"U.S.
